import React from 'react';
import './CatDetail.css';

class CatDetail extends React.Component{

	render(){
		return(
			<div className="CatDetail">
			  <div className="CatInfo">
		      	<p>{this.props.selectedCat.name}</p>
		        <p>Number of times clicked :{this.props.selectedCat.counter}</p>
	          </div>
	          <div onClick={this.props.Increment}>
	          	<img className="CatImage" src={this.props.selectedCat.url}/>
	          </div>
	          <div className="CatInfo">
	          	<p>{this.props.selectedCat.data}</p>
	          	<p>{this.props.selectedCat.age}</p>
	          </div>
	        </div>
		);
}

}


export default CatDetail;
